//Objetos literales
const persona = {
    nombre   : 'Gloria Amalia',
    apellidos: 'Martinez De Paula',
    edad     : 25,
    direccion: {
        ciudad   : 'Pinar del Rio',
        codPostal: 20100,
        activo   : true,
    }
}

console.log(persona);

/**
 * Aquí en realidad estamos asignando por referencia y esto puede no ser bueno
 * pues si en algún momento hacemos: persona2.nombre = 'Pedro'; esto cambiará el
 * valor del atributo nombre en el objeto persona.
 */
const persona2 = persona;
persona2.nombre = 'Pedro';

console.log(persona2);
